#
# TABLE STRUCTURE FOR: Blogs
#

USE go;

DROP TABLE IF EXISTS `Blogs`;

CREATE TABLE `Blogs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `AuthorID` int(10) unsigned NOT NULL,
  `Title` varchar(255) NOT NULL,
  `Content` text NOT NULL,
  `Created_at` timestamp NULL DEFAULT current_timestamp(),
  `Summary` varchar(255) NOT NULL,
  `Photo` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;



#
# TABLE STRUCTURE FOR: Category
#

DROP TABLE IF EXISTS `Category`;

CREATE TABLE `Category` (
  `Name` varchar(255) NOT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;



#
# TABLE STRUCTURE FOR: Comments
#

DROP TABLE IF EXISTS `Comments`;

CREATE TABLE `Comments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `PostID` int(10) unsigned NOT NULL,
  `UserID` int(10) unsigned NOT NULL,
  `Created_at` datetime NOT NULL,
  `Content` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Created_at` (`Created_at`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;



#
# TABLE STRUCTURE FOR: Post_Category
#

DROP TABLE IF EXISTS `Post_Category`;

CREATE TABLE `Post_Category` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `PostID` varchar(255) NOT NULL,
  `CategoryID` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;



#
# TABLE STRUCTURE FOR: Users
#

DROP TABLE IF EXISTS `Users`;

CREATE TABLE `Users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Username` varchar(50) DEFAULT NULL,
  `Password` varchar(255) DEFAULT NULL,
  `Email` varchar(50) DEFAULT NULL,
  `Name` varchar(120) DEFAULT NULL,
  `ProfilePhoto` varchar(255) NOT NULL DEFAULT '" "',
  `About` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;



